

def caesar_cipher(message, sFac)
  encMess=""
  message.split("").each do |char|
    if !char.match(/[a-zA-Z]{1}/)
      encMess+=char
      next
    end
    id=char.match(/[A-Z]{1}/) ? ((char.ord + sFac - "A".ord) % 26) + "A".ord : ((char.ord + sFac - "a".ord) % 26) + "a".ord
    encMess+=id.chr
  end
  encMess
end

